function getMatch(query) {
    var postalCodes = getPostalCodes();
    var result = [];
    var source;
    for (var i = 0; i < postalCodes.length; i++) {
        source = "";
        for (field in postalCodes[i]) {
            source += field + "|";
        }
        if (source.indexOf(query) > -1) {
            result.push(postalCodes[i].postalCode + " " + postalCodes[i].city + " " + postalCodes[i].neighborhood);
        };
        result.push(source);
    }
    return result;
}